import styled from 'styled-components';

export const Title = styled.h1`
  color: #32b8bf;
  width: 100%;
  margin-left: auto;
  margin-right: auto;
`;

export const Div = styled.div`
  width: 100px;
  margin-left: auto;
  margin-right: auto;
`;
